                              <p align="left">When it's exquisite diving aboard a luxury liveaboard in the company of a   welcoming and professional crew, look no further than <strong>The Seven Seas</strong>, a   traditional Buginese schooner, equipped with modern conveniences that bring that   essential touch of luxury to your holiday.<BR>
                                <BR>
                                Comfortably accommodating <strong>16 guests in 8 state rooms</strong> with en-suite bathrooms, The Seven Seas   promises you a high quality diving and adventure holiday mixed with relaxation   and a unique opportunity to enjoy onboard spa treatments, amazing pampering at   great value.</p>
                              <p align="left"><strong>The Seven Seas is fitted to the highest standards:</strong><BR>
                              </p>
                              <ul>
                                <LI>Four double &amp; four twin state rooms </LI>
                                <LI>En-suite bathrooms with warm water showers </LI>
                                <LI>Air-conditioned state rooms, lounge &amp; dining area </LI>
                                <LI>Large sundeck &amp; shaded outside lounging areas </LI>
                                <LI>Spacious dive deck </LI>
                                <LI>State-of-the-art galley serving mouth-watering buffets &amp; a selection of   fine wines </LI>
                                <LI>Dive &amp; snorkel equipment for hire, including Nitrox </LI>
                                </ul>
                              <p align="center"><img src="sevenseas/sevenseas_boat3.jpg" width="340" height="214"></p>
                              <p align="left"><strong>Sail with dolphins!</strong> From the bowsprit you can securely nestle in and   experience unforgettable encounters with dolphins. Or simply watch the waves   surging by. While anchored at a secluded bay, guests can take a kayak or one of   the three speed boats to explore the beaches and mangroves, or play in the waves   on a boogie board.<BR>
                                <BR>
                                Whether you choose <strong>Bali</strong>, <strong>Komodo</strong>, <strong>Wakatobi</strong>, <strong>Raja Ampat</strong>, <strong>Alor</strong> or <strong>Banda Sea</strong>, you will   appreciate the space and stability that this fine liveaboard offers with her 33m   length and 8m beam, making cruising the tropical waters of Indonesia extremely   comfortable.</p>
                              <p align="left">Situated at the center of marine diversity, these destinations - known as the   'Coral Triangle' - hold an array of colorful and intriguing marine life as well   as stunning scenery and <em>'surely the finest diving in the world.</em></p>
                              <p align="left">The Seven Sea's crew is extremely experienced having lead liveaboard adventures   in these waters for more then a decade on various vessels. Yet they remain as   committed and enthusiastic as they were on those very first trips.<BR>
                                </p>
                              <p align="center"><strong>No matter what your level of diving, your Seven Seas' dive guides will adjust   the diving to your particular comfort zone.</strong></p>
